import Grid from '@material-ui/core/Grid'
import TextField from '@material-ui/core/TextField'
import Button from '@material-ui/core/Button'

export default function MeetFirstStep({ handleNext, handleBack, handleChange, values: { date, phone, city }, filedError, isError }){

    const isEmpty = date.length > 0 && city.length > 0
    return (
        <>
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <TextField
                        fullWidth
                        InputLabelProps={{
                            shrink: true
                        }}
                        label="Fecha"
                        name="date"
                        type="date"
                        defaultValue={date}
                        onChange={handleChange('date')}
                        margin="normal"
                        required

                    />
                </Grid>

                <Grid item xs ={12}>
                    <TextField
                        fullWidth
                        id="time"
                        label="Hora"
                        type="time"
                        defaultValue="07:30"
                        InputLabelProps={{
                        shrink: true,
                        }}
                        inputProps={{
                        step: 300, // 5 min
                        }}
                    />
                </Grid>

                <Grid item xs={12}>
                    <TextField
                        fullWidth
                        label="Número de teléfono"
                        name="phone"
                        placeholder="i.e: xxx-xxx-xxxx"
                        defaultValue={phone}
                        onChange={handleChange('phone')}
                        margin="normal"
                        error={filedError.phone !== ''}
                        helperText={filedError.phone !== '' ? `${filedError.phone}` : ''}
                    />
                </Grid>
            </Grid>
            <div style={{ display: 'flex', marginTop: 50, justifyContent: 'flex-end' }}>
                <Button variant="contained" color="default" onClick={handleBack} style={{ marginRight: 20 }}>
                    Back
                </Button>
                <Button variant="contained" disabled={!isEmpty || isError} color="primary" onClick={handleNext}>
                    Next
                </Button>
            </div>
        </>
    )

}
